//! Response types of the API.
#![allow(missing_docs)]

use alloy_eips::eip4844::Blob;
use alloy_primitives::{Address, FixedBytes, B256};
use alloy_rpc_types::BlobTransactionSidecar;
use serde::{Deserialize, Serialize};
use std::str::FromStr;

/// The block response with transactions.
#[derive(Default, Debug, Clone, PartialEq, Eq, Serialize, Deserialize)]
#[serde(rename_all = "camelCase")]
pub struct BlockResponse<T = FullTransactionDetails> {
    /// Block hash.
    pub hash: B256,
    /// Block number.
    pub number: u64,
    /// Block timestamp.
    pub timestamp: chrono::DateTime<chrono::offset::Utc>,
    /// The block slot.
    pub slot: u64,
    #[serde(with = "alloy_serde::num::u128_via_ruint")]
    pub blob_gas_used: u128,
    #[serde(with = "alloy_serde::num::u128_via_ruint")]
    pub blob_as_calldata_gas_used: u128,
    #[serde(with = "alloy_serde::num::u128_via_ruint")]
    pub blob_gas_price: u128,
    #[serde(with = "alloy_serde::num::u128_via_ruint")]
    pub excess_blob_gas: u128,
    /// Blob transactions in the blob
    pub transactions: Vec<T>,
}

impl BlockResponse {
    /// Returns an iterator over all blob sidecars in the block with their tx hash.
    pub fn blob_sidecars(&self) -> impl Iterator<Item = (B256, BlobTransactionSidecar)> + '_ {
        self.transactions.iter().map(|tx| (tx.hash, tx.blob_sidecar()))
    }
}

/// The transaction object with __all__ requested data.
#[derive(Default, Debug, Clone, PartialEq, Eq, Serialize, Deserialize)]
#[serde(rename_all = "camelCase")]
pub struct FullTransactionDetails {
    /// Transaction hash.
    pub hash: B256,
    /// Blobs in the transaction.
    pub blobs: Vec<BlobInfo>,
    /// Sender address.
    pub from: Address,
    /// Receiver address,
    pub to: Address,
    /// The max fee per blob gas for EIP-4844 blob transactions.
    #[serde(with = "alloy_serde::num::u128_via_ruint")]
    pub max_fee_per_blob_gas: u128,
    #[serde(with = "alloy_serde::num::u128_via_ruint")]
    pub blob_as_calldata_gas_used: u128,
    #[serde(with = "alloy_serde::num::u128_via_ruint")]
    pub blob_as_calldata_gas_fee: u128,
    #[serde(with = "alloy_serde::num::u128_via_ruint")]
    pub blob_gas_base_fee: u128,
    #[serde(with = "alloy_serde::num::u128_via_ruint")]
    pub blob_gas_max_fee: u128,
    #[serde(with = "alloy_serde::num::u128_via_ruint")]
    pub blob_gas_used: u128,
}

impl FullTransactionDetails {
    /// Returns the sidecar for the transaction.
    pub fn blob_sidecar(&self) -> BlobTransactionSidecar {
        BlobTransactionSidecar {
            blobs: self.blobs.iter().map(|blob| *blob.data.clone()).collect(),
            commitments: self.blobs.iter().map(|blob| blob.commitment).collect(),
            proofs: self.blobs.iter().map(|blob| blob.proof).collect(),
        }
    }
}

/// The block response with selected data.
#[derive(Default, Debug, Clone, PartialEq, Eq, Serialize, Deserialize)]
#[serde(rename_all = "camelCase")]
pub struct SelectedTransactionDetails {
    /// Transaction hash.
    pub hash: B256,
    /// Blobs in the transaction.
    pub blobs: Vec<BlobInfo>,
    // TODO add optional tx info
}

/// A single blob in a transaction
#[derive(Default, Debug, Clone, PartialEq, Eq, Serialize, Deserialize)]
#[serde(rename_all = "camelCase")]
pub struct BlobInfo {
    /// The index of the blob in the block
    pub index: usize,
    /// The versioned hash of the blob
    pub versioned_hash: B256,
    /// Storage info
    pub data_storage_references: Vec<DataStorageReference>,
    /// The blob data
    #[serde(deserialize_with = "deserialize_blob")]
    pub data: Box<Blob>,
    /// The blob's commitment
    pub commitment: FixedBytes<48>,
    /// The blob's proof
    pub proof: FixedBytes<48>,
    /// Size of the blob
    pub size: usize,
}

/// Where the blob data is stored
#[derive(Default, Debug, Clone, PartialEq, Eq, Serialize, Deserialize)]
#[serde(rename_all = "camelCase")]
pub struct DataStorageReference {
    /// The storage provider
    pub blob_storage: String,
    /// data location
    pub data_reference: String,
}

/// Response for a transaction.
#[derive(Default, Debug, Clone, PartialEq, Eq, Serialize, Deserialize)]
#[serde(rename_all = "camelCase")]
pub struct TransactionDetails {
    pub hash: B256,
    pub block_number: u64,
    pub block_hash: B256,
    pub rollup: Option<String>,
    pub blobs: Vec<BlobInfo>,
    // Info about the block
    pub block: BlockInfo,
    /// Sender address.
    pub from: Address,
    /// Receiver address,
    pub to: Address,
    /// The max fee per blob gas for EIP-4844 blob transactions.
    #[serde(with = "alloy_serde::num::u128_via_ruint")]
    pub max_fee_per_blob_gas: u128,
    #[serde(with = "alloy_serde::num::u128_via_ruint")]
    pub blob_as_calldata_gas_used: u128,
    #[serde(with = "alloy_serde::num::u128_via_ruint")]
    pub blob_as_calldata_gas_fee: u128,
    #[serde(with = "alloy_serde::num::u128_via_ruint")]
    pub blob_gas_base_fee: u128,
    #[serde(with = "alloy_serde::num::u128_via_ruint")]
    pub blob_gas_max_fee: u128,
    #[serde(with = "alloy_serde::num::u128_via_ruint")]
    pub blob_gas_used: u128,
}

impl TransactionDetails {
    /// Returns the sidecar for the transaction.
    pub fn blob_sidecar(&self) -> BlobTransactionSidecar {
        BlobTransactionSidecar {
            blobs: self.blobs.iter().map(|blob| *blob.data.clone()).collect(),
            commitments: self.blobs.iter().map(|blob| blob.commitment).collect(),
            proofs: self.blobs.iter().map(|blob| blob.proof).collect(),
        }
    }
}

/// Info about the block.
#[derive(Default, Debug, Clone, Copy, PartialEq, Eq, Serialize, Deserialize)]
#[serde(rename_all = "camelCase")]
pub struct BlockInfo {
    /// Block hash.
    pub hash: B256,
    /// Block timestamp.
    pub timestamp: chrono::DateTime<chrono::offset::Utc>,
    /// The block slot.
    pub slot: u64,
    #[serde(with = "alloy_serde::num::u128_via_ruint")]
    pub blob_gas_used: u128,
    #[serde(with = "alloy_serde::num::u128_via_ruint")]
    pub blob_as_calldata_gas_used: u128,
    #[serde(with = "alloy_serde::num::u128_via_ruint")]
    pub blob_gas_price: u128,
    #[serde(with = "alloy_serde::num::u128_via_ruint")]
    pub excess_blob_gas: u128,
}

// Helper function to deserialize boxed blobs
fn deserialize_blob<'de, D>(deserializer: D) -> Result<Box<Blob>, D::Error>
where
    D: serde::de::Deserializer<'de>,
{
    let s = String::deserialize(deserializer)?;
    Blob::from_str(&s).map(Box::new).map_err(serde::de::Error::custom)
}

